$_MODULE['<{prestacenterxmlexportfree}prestashop>feedlegend_33afd02d0f448c751ce07cc65b123d38'] = 'List of the product categories (e.g. \"Clothing | Women | Summer | Swimwear\"). The separator can specify a different character, such as:';
$_MODULE['<{prestacenterxmlexportfree}prestashop>feedlegend_ed1b8c6a8edd73a7767f421c63aad9bf'] = 'Product URL (in shop)';
$_MODULE['<{prestacenterxmlexportfree}prestashop>feedlegend_c8a1da0bb7e8a32137879df5f34fbf11'] = 'Product image URL';
$_MODULE['<{prestacenterxmlexportfree}prestashop>feedlegend_74ab351eaad7c144ca073f3eff2b7513'] = 'Status of the product (new, used, refurbished). You can use your own values in the feed: enter your own values after the colon, separate values with a decimal point, also, enter your own values in this order \"new\", \"sale\", \"refurbished product\", such as:';
$_MODULE['<{prestacenterxmlexportfree}prestashop>feedlegend_cd1803581af8ed1e0857a635845a6f62'] = 'Price tax included as a decimal number. For example: \"25.50\"';
$_MODULE['<{prestacenterxmlexportfree}prestashop>feedlegend_2b2a7f2ee73680e7076d3fa9c20148bf'] = 'Price tax included as a decimal number, including the currency sign. For example as \"$25.50\".';
$_MODULE['<{prestacenterxmlexportfree}prestashop>feedlegend_e890d5aca32cdcaf88caf2fb328cb38c'] = 'Price tax included as a decimal number, including the relevant ISO code for the currency (as per ISO 4217). For example as \"25.50 USD\".';
$_MODULE['<{prestacenterxmlexportfree}prestashop>feedlegend_9bc9c69757df7b49715da0a7e2c0ec63'] = 'Products is available only in the e-shop (= 1) or in the brick and mortar store (= 0).';
$_MODULE['<{prestacenterxmlexportfree}prestashop>feedlegend_1aacaa11429bcea0d2e31905d3599be9'] = 'Date and time of the last product change (in GMT). The default format is Atom 1.0 (e.g. \"2012-12-08T14:29:57+00:00\"), but you can enter your own format (see PHP date() function). Example of the custom format:';
$_MODULE['<{prestacenterxmlexportfree}prestashop>feedlegend_e424774a5916e074212dc627e193d89e'] = 'Date and time when the feed was created (GMT). You can use your own format.';
$_MODULE['<{prestacenterxmlexportfree}prestashop>feedlegend_72ebe7adff8cd643742c1788f1b2a2b7'] = 'The language code of the feed (e.g. \"en-us\" for American English).';
$_MODULE['<{prestacenterxmlexportfree}prestashop>feedlegend_3b754cdee0c6513e0090a0bad9d9db9b'] = 'Two-letter language code according to ISO 639-1 (e.g. \"en\" for English).';
$_MODULE['<{prestacenterxmlexportfree}prestashop>feedlegend_8e8e6e248d40d788f7e9af05956216bc'] = 'Note to special characters';
$_MODULE['<{prestacenterxmlexportfree}prestashop>feedlegend_ec7d5a909f9fc8ee7a4189405f751691'] = 'HTML tags are automatically deleted from HTML tags or special characters (angle brackets or ampersands are converted to HTML entities).';
$_MODULE['<{prestacenterxmlexportfree}prestashop>feedlegend_ee8f1c8ed585b5625b0e8df2c0de81a2'] = 'This behavior can be changed in the Pro version according to your preferences.';
$_MODULE['<{prestacenterxmlexportfree}prestashop>feedlegend_808aaaa33716529eb7c9f658ff4a15b5'] = 'Product availability';
$_MODULE['<{prestacenterxmlexportfree}prestashop>feedlegend_14f7610283b9ee1ab47a46ad9c231489'] = 'You have two variables at your disposal to indicate the availability of the product : \"days\" and \"availability\". Both are governed by the stock of the availability of the product (i.e. if the product is available for order), see the \"Available for order\" in the Information tab (Catalog > Products). If there is a text entered to the product that is displayed in your e-shop (front office), depending on whether the product is / is not available / is available to order (see card Quantities), the values from this text may be used. The \"days\" variable is simpler, the first number found will be displayed. Variable \"availability\" is able to distinguish between numbers (the number of days needed for delivery) and dates (e.g. when the product will be available). You can set various values for the availability. e.g. in stock / to order / sold out.';
$_MODULE['<{prestacenterxmlexportfree}prestashop>feedlegend_65d1800737b0167fcb470907fc3c0b91'] = 'If the product is in stock, the first number from the text displayed in your shop as products in stock or the zero will be inserted into the feed. If the product is not in stock and the product availability is empty, then no value will be returned. Then it depends on the feed setting if the XML tag may be empty or not.';
$_MODULE['<{prestacenterxmlexportfree}prestashop>feedlegend_f6073a955c77cf3c8376d37aa8ccb496'] = 'This variable enables you to specify various custom values - like {condition}. Default functionality is this: for products that are in stock, the identical number as {days} is entered. The same applies for products that are not in stock, but can be ordered. If a product is unavailable, it will not be inserted in the feed at all.';
$_MODULE['<{prestacenterxmlexportfree}prestashop>feedlegend_5e95660d8f89d53e778c2be9e7dc0c78'] = 'Customization options: enter your own values in this order - \"in stock\", \"to order\" and \"sold out\". They should not start with a number sign, which is reserved for special values. You can enter spaces after commas for improve readability.';
$_MODULE['<{prestacenterxmlexportfree}prestashop>feedlegend_fd05d7f6bfc90e815087880e8e915b43'] = 'Examples:';
$_MODULE['<{prestacenterxmlexportfree}prestashop>feedlegend_8d5373cfcd25d53d49529403e0f5b94f'] = 'For products that are in stock, in \"stock\" is inserted into the feed. The other two values are for products that are not in stock. If it is allowed to order products which are not in stock, then the second value \"on order\" is used. If it is not permitted to order the product and the third value is entered, the \"sold out\" value is used. If it is not permitted to order the product and the third value is missing, the product will not be exported at all.';
$_MODULE['<{prestacenterxmlexportfree}prestashop>feedlegend_2c4261d887578ef5095a1e4817beaa4f'] = 'Inserts the entered texts, unavailable products are added into the feed as well.';
$_MODULE['<{prestacenterxmlexportfree}prestashop>feedlegend_608310cd01dadb86e4f25b460d27c0a0'] = 'For products in stock, a number of products is entered. For products in order, a number or date is entered. Unavailable products are not added to the feed at all (this is the default value).';
$_MODULE['<{prestacenterxmlexportfree}prestashop>feedlegend_0642848367ccb9190d7d9de721991265'] = 'If you want to further differentiate products in stock according to the delivery time, enter the number of days. If the value is less than or equal to the availability represented by the number of days and by the later availability value, separate it by a colon. According to this example, for the products in stock that are to be sent within three days, the \"immediately\" value is inserted. For the other products in stock, the \"on the way value is inserted. For other products, number / date is entered.';
$_MODULE['<{prestacenterxmlexportfree}prestashop>feedlegend_e5472aea187bb18cb4ef76fe839b34db'] = 'For products with \"in stock\" status, a number of products is entered. For products with \"on the way\" status, a number or date is entered. Unavailable products are not added to the feed at all (this is the default value).';
$_MODULE['<{prestacenterxmlexportfree}prestashop>feedlegend_d2485422084f95b260b683798d114bc8'] = 'Settings for Google Merchant: for the products that are to be shipped within three days,\"in stock\" is inserted. For other products in stock, \"available for order\" is inserted. For products that are not in stock, but orders of such products are accepted, \"preorder\" is inserted. For the unavailable products \"out of stock\" is inserted.';
$_MODULE['<{prestacenterxmlexportfree}prestashop>feedlegend_20baeeca76a0e1c3117358a90f33194a'] = 'Show general information';
$_MODULE['<{prestacenterxmlexportfree}prestashop>feedlegend_6b52b1374387d3f70d9549fc4a98e764'] = 'Show help to product availability';
